 A 5 table structure to create naics industry classification into a MySql database
 Based on 2017 NAICS data
 https://www.census.gov/eos/www/naics/downloadables/downloadables.html
 
*/

DROP TABLE IF EXISTS `naics_codes_6`;
DROP TABLE IF EXISTS `naics_codes_5`;
DROP TABLE IF EXISTS `naics_codes_4`;
DROP TABLE IF EXISTS `naics_codes_3`;
DROP TABLE IF EXISTS `naics_codes_2`;
CREATE TABLE `naics_codes_2` (
  `code` char(2) NOT NULL COMMENT 'Two-letter or number code',
  `name` varchar(255) NOT NULL COMMENT 'English country name',
  PRIMARY KEY (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `naics_codes_3` (
  `code` char(3) NOT NULL COMMENT 'Three-letter or number code',
  `name` varchar(255) NOT NULL COMMENT 'English country name',
	`naics_codes_2_code` char(2) NOT NULL,
  PRIMARY KEY (`code`),
  KEY `naics_codes_2_code` (`naics_codes_2_code`),
  CONSTRAINT `fk_codes3_codes2` FOREIGN KEY (`naics_codes_2_code`) REFERENCES `naics_codes_2` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `naics_codes_4` (
  `code` char(4) NOT NULL COMMENT '4-letter or number code',
  `name` varchar(255) NOT NULL COMMENT 'English country name',
	`naics_codes_3_code` char(3) NOT NULL,
  PRIMARY KEY (`code`),
  KEY `naics_codes_3_code` (`naics_codes_3_code`),
  CONSTRAINT `fk_codes4_codes3` FOREIGN KEY (`naics_codes_3_code`) REFERENCES `naics_codes_3` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `naics_codes_5` (
  `code` char(5) NOT NULL COMMENT '5-letter or number code',
  `name` varchar(255) NOT NULL COMMENT 'English country name',
	`naics_codes_4_code` char(4) NOT NULL,
  PRIMARY KEY (`code`),
  KEY `naics_codes_4_code` (`naics_codes_4_code`),
  CONSTRAINT `fk_codes5_codes4` FOREIGN KEY (`naics_codes_4_code`) REFERENCES `naics_codes_4` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

CREATE TABLE `naics_codes_6` (
  `code` char(6) NOT NULL COMMENT '6-letter or number code',
  `name` varchar(255) NOT NULL COMMENT 'English country name',
	`naics_codes_5_code` char(5) NOT NULL,
  PRIMARY KEY (`code`),
  KEY `naics_codes_5_code` (`naics_codes_5_code`),
  CONSTRAINT `fk_codes6_codes5` FOREIGN KEY (`naics_codes_5_code`) REFERENCES `naics_codes_5` (`code`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


BEGIN;




COMMIT;
SET FOREIGN_KEY_CHECKS = 1;